import React, { useState } from "react";
import {
  Typography,
  TextField,
  Button,
  Stepper,
  Step,
  StepLabel,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import {
  Modal,

  Form,
  Col,
  Row,
  Container,
  FormGroup,
} from "react-bootstrap";
const useStyles = makeStyles((theme) => ({
  button: {
    marginRight: theme.spacing(1),
  },
}));

function getSteps() {
  return [
    "Personal Information",
    "Address & Region",
    "Education Information",
    "Previous Information",
    "Employement Details",
    "Bank Details"
  ];
}

function getStepContent(step) {
  // const [childModel1, setShowChildModel1] = useState(false);
  // const [childModel, setShowChildModel] = useState(false);
  // const Closechildmodal = () => setShowChildModel(false);
  // const Closechildmodal1 = () => setShowChildModel1(false);


  let navigate = useNavigate();
  const url2 = "/departments";
  const url = "/employees";
  const url1 = "/auth/register";
  const [dep, setDep] = useState([]);
  const [datas, setData] = useState();
  // const [modalShow, setModalShow] = React.useState(false);
  const handleClose = () => setShow(false);
  const Closechildmodal = () => setShowChildModel(false);
  const Closechildmodal1 = () => setShowChildModel1(false);
  const showChildModel = () => setShowChildModel(true);
  const showChildModel1 = () => setShowChildModel1(true);
  const handleShow = () => setShow(true);
  const [childModel, setShowChildModel] = useState(false);
  const [childModel1, setShowChildModel1] = useState(false);
  const [show, setShow] = useState(false);
  const [birth,setbirth] = useState("")
  const [testUpdate, setTestUpdate] = useState(false);

  const [list, setlist] = useState(false);
  //for profile pic
  const [file, setfile] = useState();
  //Employee Add
  const [emp, setEmp] = useState({
    profilepic: "",
    firstname: "",
    lastname: "",
    dob: "",
    cnic: "",
    gender: "",
    martialStatus: "",
    religion: "",
    jobtitle: "",
    username: "",
    primaryemail: "",
    secondaryemail: "",
    password: "",
    primaryphone: "",
    secondaryphone: "",
    permanentaddress: "",
    temporaryaddress: "",
    province: "",
    city: "",
    postalCode: "",
    departments: "",
    designation: "",
    joiningdate: "",
    educationdetails: "",
    employementhistory: "",

    currentSalary: "",
    employementstatus: "",
    //bank information
    bankname: "",
    paymentmode: "",
    accounttitle: "",
    accountno: "",
    IBAN: "",
    branchcode: "",
    country:"",
    //degree info
  });
  //educaion details add and remove //
  const [education, seteducation] = useState([]);
  const [selected, setSelected] = useState("");
  const [country, setcountry] = useState("");
  const [employement, setemployement] = useState([]);
  const [empdetails, setempdetails] = useState({
    company: "",
    position: "",
    joiningdate: "",
    resignationdate: "",
    duration: "",
    jobdescription: "",
  });
  const [details, setdetails] = useState({
    degreetitle: "",
    institute: "",
    start: "",
    end: "",
    status: "",
  });
  const removeitem = (i) =>{
        const temp = education;
        temp.splice(i,1); 
        console.log("splice",temp)
        seteducation(temp);
        setTestUpdate(!testUpdate)
  }
  const removemployement = (i) =>{
    const temp = employement;
    employement.splice(i,1); 
    console.log("splice",temp)
    setemployement(temp);
    setTestUpdate(!testUpdate)
  }
  const addhistory = () => {
    var empl = employement;
    empl.push({
      company: empdetails.company,
      position: empdetails.position,
      joiningdate: empdetails.joiningdate,
      resignationdate: empdetails.resignationdate,
      duration: empdetails.duration,
      jobdescription: empdetails.jobdescription,
    });
    console.log("emplllllllll", empl);
    setemployement(empl);
    setEmp({ ...emp, employementhistory: empl });
  };
  
  let name, value;
  const handleinput = (e) => {
    console.log(e);
    name = e.target.name;
    value = e.target.value;
    setEmp({ ...emp, [name]: value });
  };

  const handleeducationdetails = async (e) => {
    let name, value;

    name = e.target.name;
    value = e.target.value;

    await setdetails({
      ...details,   
      [name]: value,
    });
  };

  //handle user input form data

  const handleempinput = async (e) => {
    let name, value;

    name = e.target.name;
    value = e.target.value;

    await setempdetails({
      ...empdetails,
      [name]: value,
    });
  };

  const addeducation = () => {
    var temp = education;
    temp.push({
      degreetitle: details.degreetitle,
      institute: details.institute,
      start: details.start,
      end: details.end,
      status: details.status,
    });
    seteducation(temp);
    setEmp({ ...emp, educationdetails: education });
  
  };

  const handleempinputJoiningDate = async (e) => {
    let name, value;

    name = e.target.name;
    value = e.target.value;

    console.log("change", empdetails);

    var a = moment(empdetails.resignationdate);
    var b = moment(e.target.value);

    var years = a.diff(b, "year");
    b.add(years, "years");

    var months = a.diff(b, "months");
    b.add(months, "months");

    var days = a.diff(b, "days");

    console.log(years + " years " + months + " months " + days + " days");

    await setempdetails({
      ...empdetails,
      [name]: e.target.value,
      duration: `${years}  years  ${months}  months  ${days} days`,
    });
  };

  const handleempinputResignationDate = async (e) => {
    let name, value;

    name = e.target.name;
    value = e.target.value;

    var a = moment(e.target.value);
    var b = moment(empdetails.joiningdate);

    var years = a.diff(b, "year");
    b.add(years, "years");

    var months = a.diff(b, "months");
    b.add(months, "months");

    var days = a.diff(b, "days");

    console.log(years + " years " + months + " months " + days + " days");

    await setempdetails({
      ...empdetails,
      [name]: e.target.value,
      duration: `${years}  years  ${months}  months  ${days} days`,
    });
  };
   ///education & employement details code end;

   //list and grid view start
  const [view, setView] = useState(false);
  const handleChange = (event, nextView) => {
    setView(!view);
    setView(nextView);
    setView(!view);
    // setlist(nextView)
    console.log(nextView);
  };
  //   const handleChange = () => {
  //     setlist(!list)
  //   };
  //submitting values of user
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (file) {
      const data =new FormData();
      const filename = Date.now() + file.name;
      data.append("name", filename);
      data.append("file", file);
      emp.profilepic = filename;
      try {
        await axios.post("/upload",data);
      } catch (err) {
        console.log(err);
        NotificationManager.error("Pic not Uploaded");
      }
    }
   
    try {
      const res = await axios.post(url1, emp);
      console.log(res);
      res && NotificationManager.success("Sucessfully Added Employee");
      // res && window.location.replace("/employees");
    } catch (error) {
      console.log(error);
      NotificationManager.error("Something went wrong ");
    }
  };
  //fetching employees data
  const fetchData = async () => {
    try {
      const res = await axios.get(url);
      console.log(res.data);
      const data = res.data.employees;
      setData(data);
    } catch (error) {
      console.log(error);
      NotificationManager.error("Api Error 404");
    }
  };
  //getting Employees
  const getEmp = async () => {
    try {
      const res = await axios.get(url2);
      const datas = res.data.departments;
      console.log("departments", datas);
      setDep(datas);
    } catch (error) {
      console.log(error);
    }
  };
  useEffect(() => {
    fetchData();
    getEmp();
  }, []);
  const PF = "http://localhost:5002/images/";
  switch (step) {
    case 0:
      return (
        <>
          
          <div className="w-75" id="responsivewidth">
                  <Col>
                    <Row >
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>First Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="firstname"
                            placeholder="First Name"
                            // value={emp.firstname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Last Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="lastname"
                            placeholder="Last Name"
                            // value={emp.lastname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6' md='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridgender"
                          className="formmargin"
                        >
                          <Form.Label>Gender</Form.Label>
                          <Form.Select
                            required
                            name="gender"
                            // value={emp.gender}
                            // onChange={handleinput}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Male</option>
                            <option>Female</option>
                            <option>Other</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>National ID </Form.Label>
                          <Form.Control
                            type="number"
                            required
                            name="cnic"
                            placeholder="CNIC"
                            // value={emp.cnic}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>D-0-B</Form.Label>
                          {/* <DatePicker
                            required
                            selected={emp.dob}
                            onChange={(date)=>{setEmp({...emp,dob:moment(date).format('dd/mm/yyyy')})}}
                            // dateFormat='d MMMM, yyyy'
                            dateFormat='dd/mm/yyyy'
                            dropDownMode="select"
                          /> */}
                          <Form.Control
                            type="date"
                            required
                            placeholder="dd/mm/yyyy"
                            name="dob"
                            // value={emp.dob}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>

                      <Col  xl='6' lg="6" >
                        <Form.Group
                          as={Col}
                          controlId="formGridMartialStatus"
                          className="formmargin"
                        >
                          <Form.Label>Martial Status</Form.Label>
                          <Form.Select
                            required
                            name="martialStatus"
                            placeholder="martial status.."
                            // value={emp.martialStatus}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Single</option>
                            <option>Married</option>
                            <option>Divorced</option>
                            <option>widow</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Religion</Form.Label>
                          <Form.Select
                            required
                            name="religion"
                            placeholder="Religion"
                            // value={emp.religion}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Islam</option>
                            <option>Christianity</option>
                            <option>Buddhism</option>
                            <option> Sikhism</option>
                            <option> Hinduism</option>
                            <option>Bah</option>
                            <option>Confucianism</option>
                            <option>Jainism</option>
                            <option>Judaism</option>
                            <option>Zoroastrianism</option>
                            <option>Druze</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                    </Row>
                  </Col>
                  <div className=" reswidth ">
                  <Col xxl="4" xl="4" lg="4" >
                 
                 <div style={{ width: "100%" }}>
                   <div className="d-flex align-items-center responsiveimg">
                     <div>
                     <Form className='mb-3' controlId="formGridProfilePic">
                                
                                   
                                  
                                    
                                 <Form.Label htmlFor='uploadpic' > 
                                     {file ? <img  className="rounded-circle" style={{ width: "200px", height: "200px" }} src={URL.createObjectURL(file)} alt="" /> : <img  className="rounded-circle" src={pp} alt="" style={{ width: "200px", height: "200px" }} />}
                                 </Form.Label>
                                 
                                 
                                 <Form.Control type="file"
                                     name='file'
                                     value={emp.profilepic}
                                     style={{ display: "none" }}
                                     id='uploadpic'
                                     
                                     onChange={(e) => setfile(e.target.files[0])}
                                 />
                                 <div className="w-100 text-center">
                                   <label>Upload Picture</label>
                                 </div>
                                 
                       </Form>
                     </div>
                   </div>
                 </div>
               </Col>
                  </div>
                  
                  </div>
                  
        </>
      );

    case 1:
      return (
        <>
         
            <div>
          <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Primary
                    </h5>
           <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridphone"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="primaryphone"
                          placeholder="phone"
                          // value={emp.primaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="primaryemail"
                          placeholder="email"
                          // value={emp.primaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                  </Row>

                  <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Secondary
                    </h5>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="secondaryphone"
                          placeholder="secondary phone"
                          // value={emp.secondaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="secondaryemail"
                          placeholder="secondary Email"
                          // value={emp.secondaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    </Row>
                    </div>
        </>
      );
    case 2:
      return (
        <>
         <div>
            <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Temporary Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="temporaryaddress"
                      placeholder="complete address"
                      // value={emp.temporaryaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>

                <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Permanent Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="permanentaddress"
                      placeholder="complete address"
                      // value={emp.permanentaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                {/* </Row> */}
                <div style={{marginLeft:'0.75%'}}>
                <Row>
                  <Col>
                    <Form.Label style={{marginLeft:'2%'}}>City</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        // onChange={handleinput}
                        name="city"
                        // value={emp.city}
                      >
                        <option value="" selected hidden disabled>
                          Select City
                        </option>
                        {/* {cities.map((d, i) => {
                          return <option key={i}>{d}</option>;
                        })} */}
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Province</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        name="province"
                        placeholder="province"
                        // value={emp.province}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      >
                        <option value="" selected hidden disabled>
                          Select Province
                        </option>
                        <option>Punjab</option>
                        <option>Sindh</option>
                        <option>KPK</option>
                        <option>Gilgit Baltistan</option>
                        <option>Islamabad(Capital Territory)</option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Country</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      {/* <ReactFlags
                        countries={["PK"]}
                        selected={selected}
                        onSelect={(code) => {
                          setSelected(code);
                          code === "PK" && setcountry("Pakistan");
                          setEmp({...emp,country:"Pakistan"})
                        }}
                      /> */}
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col lg={4} xl={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Postal Code</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="postalCode"
                        placeholder="postal code"
                        // value={emp.postalCode}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                </div>
                </div>
        </>
      );
    case 3:
      return (
        <>
          {/* <TextField
            id="cardNumber"
            label="Card Number"
            variant="outlined"
            placeholder="Enter Your Card Number"
            fullWidth
            margin="normal"
            name="cardNumber"
          />
          <TextField
            id="cardMonth"
            label="Card Month"
            variant="outlined"
            placeholder="Enter Your Card Month"
            fullWidth
            margin="normal"
            name="cardMonth"
          />
          <TextField
            id="cardYear"
            label="Card Year"
            variant="outlined"
            placeholder="Enter Your Card Year"
            fullWidth
            margin="normal"
            name="cardYear"
          /> */}
          <Modal
          aria-labelledby="contained-modal-title-vcenter"
